import React from 'react';
import "./TodoSearch.css";

function TodoSearch({
  searchValue,
  setSearchValue,
}) {

  return (
    <input className="sinbordefondo"
      placeholder="Escribe algo para buscar"
      value={searchValue}
      onChange={(event) => {
        setSearchValue(event.target.value);
      }} />
  );
}
export { TodoSearch };
